import FakeBookings from "./data/fakeBookings.json";

const SearchResults = (props) => {
    const cont = 0;
    FakeBookings.map((booking , index) => {
        if (props === FakeBookings.firstName){
            cont = 1;
            return(
              <div 
              key={index} id={booking.id}>
                <p>Title : {booking.title}</p>
                <p>First name : {booking.firstName}</p>
                <p>Surname : {booking.surname}</p>
                <p>Email : {booking.email}</p>
                <p>Room Number : {booking.roomId}</p>
                <p>CheckInDate : {booking.checkInDate}</p>
                <p>CheckOutDate : {booking.checkOutDate}</p>
              </div>
            )
        }else {
            cont = 0;
        }
    })
    if (cont = 0){ return ( <p> WE do NOT have this coustomer </p>)};
}

export default SearchResults;
